import React from 'react';

export const Projects = () => {
  const projects = [
    { title: 'CONNECT 4', description: 'A classic strategy game', link: 'https://connect-four-game-rl4oxumnp-unnathi-baskars-projects.vercel.app' },
    { title: 'Project Title 2', description: 'Lorem Ipsum is dummy text of the printing industry.', link: '#' },
    { title: 'Project Title 3', description: 'Lorem Ipsum is dummy text of the printing industry.', link: '#' },
    { title: 'Project Title 4', description: 'Lorem Ipsum is dummy text of the printing industry.', link: '#' },
  ];

  return (
    <div className="projects-section">
      <div className="projects-header">
        <h1>Projects</h1>
        <p>
        Explore my projects, showcasing technical expertise and creative problem-solving. Each one highlights my ability to design and deliver impactful and innovative solutions.
        </p>
      </div>

      <div className="tabs-container">
        <button className="tab-button">Tab 1</button>
        <button className="tab-button">Tab 2</button>
        <button className="tab-button">Tab 3</button>
      </div>

      <div className="projects-container">
        {projects.map((project, index) => (
          <a key={index} href={project.link} className="project-card">
            <h2>{project.title}</h2>
            <p>{project.description}</p>
          </a>
        ))}
      </div>
    </div>
  );
};
